import React from 'react';
import styled from 'styled-components';

const inputStyle = styled.input`
  border: '2px solid #FFF',
  padding: '5px',
  borderRadius: '10px',
  cursor: 'pointer',
  transition: '1s'
`;

const manualBtn = () => {
  render (
      <>
        <inputStyle />
      </> 
  )
}

export default manualBtn;
